import React, { Component } from "react";
import "./App.css";
import Header from "./components/Header";
import RentalCard from "./components/Rental/RentalCard";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <div class="container">
          <h1>Places to stay around the world</h1>
          <div class="row">
            <RentalCard />
            <RentalCard />
            <RentalCard />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
